import React from 'react';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import { useState } from 'react';

import History from './pages/History';
import AddMedicationPage from './pages/AddMedicationPage';
import AddTicketPage from './pages/AddTicketPage';
import LoginPage from './pages/LoginPage';
import Conditioning from './pages/Conditioning';
import ListMedication from './pages/ListMedication';
import Mutual from './pages/Mutual';
import Service from './pages/Service';


function App() {
  return (
<Router>
  <Routes></Routes>
  <Route exact path="/history/:whichPage/:allOpen" component={History} />
  <Route exact path='/listMedication' component={ListMedication} />
  <Route exact path='/conditioning' component={Conditioning} />
  <Route exact path='/mutual' component={Mutual} />
  <Route exact path='/service' component={Service} />
  <Route exact path='/ticketSale' component={AddTicketPage} />
  <Route exact path='/medicationSale' component={AddMedicationPage} />
  <Route exact path='/' component={LoginPage} />
</Router>
  );
  return (
    //<History whichPage={'pharmacie'} allOpen={true} />
